$(document).ready(function () {



    var now = new Date();
    var titleDate = now.getFullYear() + "-" + (now.getMonth() + 1) + "-" + now.getDate()

    $('#businessTbl').DataTable({
        "ordering": false,
        "pageLength": 25,
        dom: 'Bftpr',
        language: {
            search: "_INPUT_",
            searchPlaceholder: "Search",
        },



        buttons: [


            {
                extend: 'excelHtml5',
                autoFilter: true,
                title: "Business Clearance Transaction Report",
                sheetName: 'Businesss Clearance Sales'
            },

            {
                extend: 'pdfHtml5',
                title: "business-clearance-" + titleDate,
                pageSize: 'A4',
                // download: 'open',
                exportOptions: {
                    search: 'applied',
                    order: 'applied',
                    stripNewlines: false
                },
                customize: function (doc) {
                    var rdoc = doc;
                    var rcout = doc.content[doc.content.length - 1].table.body.length - 1;
                    doc.content.splice(0, 1);
                    var now = new Date();
                    var jsDate = now.getDate() + '/' + (now.getMonth() + 1) + '/' + now.getFullYear() + ' Time: ' + now.getHours() + ':' + now.getMinutes() + ':' + now.getSeconds();
                    doc.pageMargins = [30, 90, 30, 30];


                    // doc.defaultStyle.font = 'Montserrat';
                    doc.defaultStyle.fontSize = 9;

                    doc.styles.tableHeader.fontSize = 12;



                    doc.styles.tableHeader.fillColor = '#c4574f'
                    doc.content[doc.content.length - 1].table.headerRows = 2;



                    for (var i = 0; i < rcout; i++) {
                        var obj = doc.content[doc.content.length - 1].table.body[i + 1];
                        doc.content[doc.content.length - 1].table.body[(i + 1)][0] = {
                            text: obj[0].text,
                            style: [obj[0].style],
                            alignment: 'center',

                            bold: true
                        };
                        doc.content[doc.content.length - 1].table.body[(i + 1)][3] = {
                            text: obj[3].text,
                            style: [obj[3].style]

                            // alignment: 'left',
                            // bold: obj[3].text > 60 ? true : false,
                            // fillColor: obj[3].text > 60 ? 'red' : null
                        };





                    }

                    var logo = "data:image/png;base64,"

                    doc['header'] = (function (page, pages) {
                        return {
                            table: {
                                //widths: ['100%'],
                                widths: ['auto', 'auto'],
                                headerRows: 0,
                                body: [
                                    [{
                                            margin: [70, 0, 0, 0],
                                            width: 58, //'auto',
                                            alignment: 'center',

                                            image: logo,

                                        },
                                        {
                                            text: 'BUSINESS CLEARANCE TRANSACTIONS',
                                            alignment: 'center',
                                            fontSize: 18,
                                            bold: true,
                                            margin: [-10, 20, 0, 0],
                                            width: 'auto'

                                        }
                                    ],

                                ]
                            },
                            layout: 'noBorders',
                            margin: 10
                        }
                    });

                    doc['footer'] = (function (page, pages) {
                        return {
                            columns: [{
                                    alignment: 'left',
                                    text: ['Created Date: ', {
                                        text: jsDate.toString()
                                    }]
                                },
                                {
                                    alignment: 'center',
                                    text: 'Total Business Transactions: ' + rcout.toString()
                                },
                                {
                                    alignment: 'right',
                                    text: ['page ', {
                                        text: page.toString()
                                    }, ' of ', {
                                        text: pages.toString()
                                    }]
                                }
                            ],
                            margin: 10
                        }
                    });

                    var objLayout = {};
                    objLayout['hLineWidth'] = function (i) {
                        return .8;
                    };
                    objLayout['vLineWidth'] = function (i) {
                        return .5;
                    };
                    objLayout['hLineColor'] = function (i) {
                        return '#aaa';
                    };
                    objLayout['vLineColor'] = function (i) {
                        return '#aaa';
                    };
                    objLayout['paddingLeft'] = function (i) {
                        return 10;
                    };
                    objLayout['paddingRight'] = function (i) {
                        return 25;
                    };
                    doc.content[doc.content.length - 1].layout = objLayout;

                }
            }
        ]
    });
});